import React from 'react';
import SimpleSlider from '../Slider/Slider';
import StartSearchContainer from '../../containers/StartSearchContainer';

import './Home.css'

const Home = function () {
  return(
    <div>
      <SimpleSlider />

      <section id="search-section">
        <div className="search-wrapper">
          <div className="search-title-wrapper">
            <h2>Time is a resource that<br />we will never get more of</h2>
          </div>
            <StartSearchContainer />
        </div>
      </section>
    </div>
  );
};

export default Home;
